    [],nt"revision_timestamp": "2016-07-27T22:23:27.138909",nt"name": "seney-national-wildlife-refuge-annual-narrative-report-calendar-year-1992",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report summarizes
    activities for Seney National Wildlife Refuge, Harbor Island National Wildlife Refuge,
    and Huron Islands National Wildlife Refuge during the 1992 calendar year. The report
    begins with a summary of the yearu2019s highlights and climatic conditions. Land
    acquisition is also covered. The report includes a planning section which discusses
    the management plan, public participation, compliance with environmental and cultural
    resource mandates, research, and investigations. Refuge administration is outlined;
    information about personnel, youth programs, volunteer programs, funding, safety,
    and technical assistance is given. Habitat management is also covered. Subjects
    include wetlands, forests, croplands, haying, fire management, pest control, water
    rights, and private lands. The wildlife section of the report discusses wildlife
    diversity, endangered species, threatened species, waterfowl, marsh birds, waterbirds,
    shorebirds, raptors, game mammals, fisheries resources, wildlife propagation and
    stocking, marking, banding, and disease control. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive exhibits, hunting, fishing,
    trapping, wildlife observation, camping, law enforcement, and cooperating associations.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment utilization and replacement,
    communications systems, computer systems, and energy conservation. Refuge brochures
    are attached.",nt"license_title": "License Not Specified",nt"extras":
